data class FormField(val id: Int, val inputType: InputType, val labelText: String, val placeHolder: String = "", value: String = "") {
    var parent: Form? = null

    var initialValue: String = value

    var value: String
        get() {
            val ref = parent?.idsToRefs?.get(this.id)
            return if (ref != null) {
                (ref.getDOMNode() as HTMLInputElement).value
            } else {
                initialValue
            }
        }
        set(v) {
            (parent!!.idsToRefs[this.id]!!.getDOMNode() as HTMLInputElement).value = v ?: ""
        }
}

data class FormState(val formFields: List<FormField> = emptyList()) {

}

abstract class FormSchema() {

    private var id = 0
    val fields = arrayListOf<FormField>()

    protected fun formField(inputType: InputType, labelText: String = "", placeHolder: String = "", value: String = ""): FormField {
        val formField = FormField(id++, inputType, labelText, placeHolder, value)
        fields.add(formField)
        return formField
    }
}

open class Form(val title: String, schema: FormSchema, val subTitle: String? = null) : StatefulReactClass<FormState>(FormState(schema.fields)) {

    val idsToRefs: MutableMap<Int, ReactRef> = hashMapOf()

    final override fun render(): ReactElement? {
        return form() {
            +h3 {
                +(title + " ")
                if (subTitle != null) {
                    +small { +subTitle }
                }
            }

            state.formFields.forEach { formField ->
                formField.parent = this@Form
                val onChange = {(newValue: String) ->
                    changeState {
                        val head = state.formFields.takeWhile { it.id != formField.id }
                        val tail = state.formFields.dropWhile { it.id != formField.id }.drop(1)
                        val newFormFields = head + formField.copy(value = newValue) + tail
                        state.copy(formFields = newFormFields)
                    }
                }
                val inputField = InputField(formField.inputType, formField.labelText, formField.placeHolder, formField.value, onChange = onChange)
                val ref = inputField.inputRef
                idsToRefs.put(formField.id, ref)
                +inputField
            }
        }
    }
}

